import InputText from "components/common/Input/InputText";
import { loginFormStyle } from "styles/components/login";

const LoginForm = () => {
  return (
    <>
      <form css={loginFormStyle}>
        <InputText themeType="light" placeholder="이메일" />
      </form>
    </>
  );
};

export default LoginForm;
